import React, { Component } from 'react';

class List extends Component{
    constructor(props){
        super(props);
        this.state = {
            list : []
        }
    }
    render(){
        return(
            <div>
                <p>HELLO WORLD FROM THE LIST PAGE</p>
            </div>
        )
    }
}

export default List;
